import React from 'react';
import ReactDOM from 'react-dom';

import App from './app.js';

function sum(a, b) {
  return a + b;
}
module.exports = sum;

class Main extends React.Component {
  render() {
    return <App />;
  }
}

const rootElement = document.getElementById('root');
ReactDOM.render(<Main />, rootElement);
